import React from 'react'
import MovieCard from './moviecard'

const MovieList = ({movies}) => {
  return (
    <div className='grid'>
       {movies.map((movie, index)=>(
        <MovieCard key={index} movie={movie}/> ))}
        
    </div>
  )
}

export default MovieList
